import{_ as a}from"./plugin-vue_export-helper.21dcd24c.js";import{o as i,c as e,d as r}from"./app.a3d402e1.js";var t="/assets/project-resource-management.png",l="/assets/project-resource-management-1.png",p="/assets/project-resource-management-2.png",h="/assets/project-resource-management-3.png",s="/assets/project-resource-management-4.png",d="/assets/project-resource-management-5.png",n="/assets/project-resource-management-6.png";const c={},o=r('<div class="custom-container tip"><p class="custom-container-title">\u524D\u8A00</p><p>\u8BB0\u5F55\u9879\u76EE\u8D44\u6E90\u7BA1\u7406\u7AE0\u8282\u7684\u76F8\u5173\u77E5\u8BC6\u3001\u9891\u7E41\u8003\u70B9\u3002</p></div><h2 id="\u6838\u5FC3\u6982\u5FF5" tabindex="-1"><a class="header-anchor" href="#\u6838\u5FC3\u6982\u5FF5" aria-hidden="true">#</a> \u6838\u5FC3\u6982\u5FF5</h2><div class="custom-container tip"><p class="custom-container-title">\u63D0\u793A</p><p>\u4EBA\u624D\u662F\u4F01\u4E1A\u6700\u91CD\u8981\u7684\u8D22\u5BCC, \u9879\u76EE\u4EBA\u529B\u8D44\u6E90\u7BA1\u7406\u662F\u9879\u76EE\u7BA1\u7406\u7684\u4E00\u4E2A\u91CD\u8981\u7EC4\u6210\u90E8\u5206\u3002\u9879\u76EE\u4EBA\u529B\u8D44\u6E90\u7BA1\u7406\u7684\u56DB\u4E2A\u8FC7\u7A0B\uFF1A\u5236\u5B9A\u4EBA\u529B\u8D44\u6E90\u8BA1\u5212\u3001\u7EC4\u5EFA\u9879\u76EE\u56E2\u961F\u3001\u5EFA\u8BBE\u9879\u76EE\u56E2\u961F\u548C\u7BA1\u7406\u9879\u76EE\u56E2\u961F\u3002</p><p>\u9879\u76EE\u7ECF\u7406\u5FC5\u987B\u505A\u5230\u5BF9\u4EBA\u8981\u4F53\u8C05\u548C\u5C0A\u656C\u3001\u660E\u767D\u4EC0\u4E48\u80FD\u6FC0\u52B1\u4EBA\u3001\u4E0E\u4EBA\u4ED4\u7EC6\u6C9F\u901A, \u53EA\u6709\u96C6\u4E2D\u7CBE\u529B\u505A\u597D\u4EBA\u529B\u8D44\u6E90\u7BA1\u7406\u624D\u80FD\u4F7F\u4E0B\u5C5E\u5F88\u597D\u7684\u5B8C\u6210\u4EFB\u52A1\u3002</p></div><h3 id="\u6FC0\u52B1\u7406\u8BBA" tabindex="-1"><a class="header-anchor" href="#\u6FC0\u52B1\u7406\u8BBA" aria-hidden="true">#</a> \u6FC0\u52B1\u7406\u8BBA</h3><ul><li>\u9A6C\u65AF\u6D1B\u7684\u9700\u6C42\u5C42\u6B21\u7406\u8BBA =&gt; \u4ECE\u6700\u4F4E\u7B49\u7EA7\u5230\u6700\u9AD8\u7B49\u7EA7\u4F9D\u6B21\u662F\uFF1A\u751F\u7406\u9700\u6C42\u3001\u5B89\u5168\u9700\u6C42\u3001\u793E\u4EA4\u9700\u6C42\u3001\u5C0A\u91CD\u9700\u6C42\u3001\u81EA\u6211\u5B9E\u73B0\u9700\u6C42</li><li>\u8D6B\u5179\u4F2F\u683C\u7684\u53CC\u56E0\u7D20\u7406\u8BBA =&gt; \u4FDD\u5065\u56E0\u7D20\u3001\u6FC0\u52B1\u56E0\u7D20 <ul><li>\u4FDD\u5065\u56E0\u7D20 =&gt; \u662F\u5BFC\u81F4\u4E0D\u6EE1\u8DB3\u7684\u56E0\u7D20, \u8FD9\u4E9B\u56E0\u7D20\u505A\u5F97\u597D\u4E0D\u4F1A\u63D0\u9AD8\u6FC0\u52B1, \u505A\u7684\u4E0D\u597D\u5C31\u4F1A\u635F\u5BB3\u6FC0\u52B1</li><li>\u6FC0\u52B1\u56E0\u7D20 =&gt; \u662F\u5BFC\u81F4\u6EE1\u8DB3\u611F\u7684\u56E0\u7D20, \u80FD\u591F\u771F\u6B63\u8D77\u6FC0\u52B1\u4F5C\u7528\u7684\u3002</li></ul></li><li>\u9EA6\u683C\u96F7\u6208\u7684 X \u7406\u8BBA\u548C Y \u7406\u8BBA <ul><li>X \u7406\u8BBA\u8BA4\u4E3A\u53EA\u80FD\u7528\u4F4E\u5C42\u6B21\u7684\u9700\u6C42\u8FDB\u884C\u6FC0\u52B1</li><li>Y \u7406\u8BBA\u8BA4\u4E3A\u4EBA\u66F4\u5E94\u8BE5\u53D7\u5230\u9AD8\u5C42\u6B21\u9700\u6C42\u7684\u6FC0\u52B1, \u9F13\u52B1\u56E2\u961F\u6210\u5458\u53C2\u4E0E\u5230\u76EE\u6807\u7684\u5236\u5B9A\u4E2D, \u6CA1\u6709\u4E25\u683C\u7684\u7B49\u7EA7\u548C\u76D1\u63A7\u5236\u5EA6</li></ul></li></ul><h2 id="\u601D\u7EF4\u5BFC\u56FE" tabindex="-1"><a class="header-anchor" href="#\u601D\u7EF4\u5BFC\u56FE" aria-hidden="true">#</a> \u601D\u7EF4\u5BFC\u56FE</h2><p><img src="'+t+'" alt="\u9879\u76EE\u8D44\u6E90\u7BA1\u7406"></p><h2 id="\u89C4\u5212\u8FC7\u7A0B\u7EC4" tabindex="-1"><a class="header-anchor" href="#\u89C4\u5212\u8FC7\u7A0B\u7EC4" aria-hidden="true">#</a> \u89C4\u5212\u8FC7\u7A0B\u7EC4</h2><h3 id="\u89C4\u5212\u8D44\u6E90\u7BA1\u7406" tabindex="-1"><a class="header-anchor" href="#\u89C4\u5212\u8D44\u6E90\u7BA1\u7406" aria-hidden="true">#</a> \u89C4\u5212\u8D44\u6E90\u7BA1\u7406</h3><p>\u89C4\u5212\u8D44\u6E90\u7BA1\u7406\u662F\u5B9A\u4E49\u5982\u4F55\u4F30\u7B97\u3001\u83B7\u53D6\u3001\u7BA1\u7406\u548C\u5229\u7528\u56E2\u961F\u4EE5\u53CA\u5B9E\u7269\u8D44\u6E90\u7684\u8FC7\u7A0B\u3002</p><p>\u6570\u636E\u8868\u73B0-\u5C42\u7EA7\u578B\uFF1A</p><ul><li>\u5DE5\u4F5C\u5206\u89E3\u7ED3\u6784 WBS =&gt; \u53EF\u4EA4\u4ED8\u6210\u679C\u4E3A\u5BFC\u5411\u7684\u5DE5\u4F5C\u5C42\u7EA7\u5206\u89E3, \u6709\u52A9\u4E8E\u660E\u786E\u9AD8\u5C42\u7EA7\u7684\u6307\u8D23</li><li>\u7EC4\u7EC7\u5206\u89E3\u7ED3\u6784 OBS =&gt; \u7EC4\u7EC7\u7684\u90E8\u95E8, \u5355\u5143\u6216\u56E2\u961F\u4E3A\u5BFC\u5411\u7684\u6210\u7EE9\u5206\u89E3, \u6709\u52A9\u4E8E\u67E5\u770B\u5BF9\u5E94\u7684\u5168\u90E8\u9879\u76EE\u804C\u8D23</li><li>\u8D44\u6E90\u5206\u89E3\u7ED3\u6784 RBS =&gt; \u8D44\u6E90\u7684\u7C7B\u522B\u548C\u7C7B\u578B\u4E3A\u5BFC\u5411\u7684\u5C42\u7EA7\u5206\u89E3, \u7528\u4E8E\u89C4\u5212\u3001\u7BA1\u7406\u548C\u76D1\u63A7\u9879\u76EE\u5DE5\u4F5C</li></ul><p>RACI \u77E9\u9635 =&gt; RACI \u77E9\u9635\u5BF9\u660E\u786E\u5212\u5206\u89D2\u8272\u548C\u671F\u671B\u7279\u522B\u6709\u7528\u3002RACI \u4E2D\u6BCF\u4E2A\u6D3B\u52A8\u53EA\u80AF\u80FD\u6709\u4E00\u4E2A \u201CA\uFF08\u8D1F\u8D23\uFF09\u201D</p><ul><li>R =&gt; \u6267\u884C\uFF1BA =&gt; \u8D1F\u8D23\uFF1BC =&gt; \u54A8\u8BE2\uFF1BI =&gt; \u77E5\u60C5</li><li>\u53CD\u5E94\u4E0E\u6BCF\u4E2A\u4EBA\u76F8\u5173\u7684\u6240\u6709\u6D3B\u52A8</li><li>\u53CD\u5E94\u4E0E\u6BCF\u9879\u6D3B\u52A8\u76F8\u5173\u7684\u4EBA\u5458</li><li>\u786E\u4FDD\u4EFB\u4F55\u4E00\u9879\u4EFB\u52A1\u90FD\u53EA\u6709\u4E00\u4E2A\u4EBA\u8D1F\u8D23, \u4ECE\u800C\u907F\u514D\u804C\u8D23\u4E0D\u6E05</li></ul><p>\u8D44\u6E90\u7BA1\u7406\u8BA1\u5212\uFF1A\u8D44\u6E90\u7BA1\u7406\u8BA1\u5212\u63D0\u4F9B\u4E86\u5173\u4E8E\u5982\u4F55\u5206\u7C7B\u3001\u5206\u914D\u3001\u7BA1\u7406\u548C\u91CA\u653E\u9879\u76EE\u8D44\u6E90\u7684\u6307\u5357\u3002\u5305\u62EC\uFF1A \u89D2\u8272\u4E0E\u804C\u8D23\uFF1A</p><ul><li><p>\u89D2\u8272\uFF1A\u5728\u9879\u76EE\u4E2D, \u67D0\u4EBA\u627F\u62C5\u7684\u804C\u52A1\u6216\u5206\u914D\u7ED9\u67D0\u4EBA\u7684\u804C\u52A1\u3002</p></li><li><p>\u804C\u6743\uFF1A\u4F7F\u7528\u9879\u76EE\u8D44\u6E90\u3001\u505A\u51FA\u51B3\u7B56\u3001\u7B7E\u5B57\u6279\u51C6\u3001\u9A8C\u6536\u53EF\u4EA4\u4ED8\u6210\u679C\u5E76\u5F71\u54CD\u4ED6\u4EBA\u5F00\u5C55\u9879\u76EE\u5DE5\u4F5C\u7684\u6743\u529B\u3002</p></li><li><p>\u804C\u8D23\uFF1A\u4E3A\u5B8C\u6210\u9879\u76EE\u6D3B\u52A8, \u9879\u76EE\u56E2\u961F\u6210\u5458\u5FC5\u987B\u5C65\u884C\u7684\u804C\u8D23\u548C\u5DE5\u4F5C\u3002</p></li><li><p>\u80FD\u529B\uFF1A\u4E3A\u5B8C\u6210\u9879\u76EE\u6D3B\u52A8, \u9879\u76EE\u56E2\u961F\u6210\u5458\u9700\u5177\u5907\u7684\u6280\u80FD\u548C\u624D\u5E72\u3002</p></li><li><p>\u9879\u76EE\u7EC4\u7EC7\u56FE\uFF1A\u9879\u76EE\u7EC4\u7EC7\u56FE\u4EE5\u56FE\u5F62\u65B9\u5F0F\u5C55\u793A\u9879\u76EE\u56E2\u961F\u6210\u5458\u53CA\u5176\u62A5\u544A\u5173\u7CFB\u3002</p></li><li><p>\u57F9\u8BAD\uFF1A\u9488\u5BF9\u9879\u76EE\u6210\u5458\u7684\u57F9\u8BAD\u7B56\u7565\u3002</p></li><li><p>\u56E2\u961F\u5EFA\u8BBE\uFF1A\u5EFA\u8BBE\u9879\u76EE\u56E2\u961F\u7684\u65B9\u6CD5\u3002</p></li><li><p>\u8BA4\u53EF\u8BA1\u5212\uFF1A\u5C06\u7ED9\u4E88\u56E2\u961F\u6210\u5458\u54EA\u4E9B\u8BA4\u53EF\u548C\u5956\u52B1, \u4EE5\u53CA\u4F55\u65F6\u7ED9\u4E88\u3002</p></li></ul><p>\u56E2\u961F\u7AE0\u7A0B\uFF1A\u4E3A\u56E2\u961F\u521B\u5EFA\u56E2\u961F\u4EF7\u503C\u89C2\u3001\u5171\u8BC6\u548C\u5DE5\u4F5C\u6307\u5357\u7684\u6587\u4EF6\u3002\u5C3D\u65E9\u8BA4\u53EF\u5E76\u9075\u5B88\u660E\u786E\u7684\u89C4\u5219, \u6709\u52A9\u4E8E\u51CF\u5C11\u8BEF\u89E3, \u63D0\u9AD8\u751F\u4EA7\u529B\uFF1B\u53EF\u5B9A\u671F\u5BA1\u67E5\u548C\u66F4\u65B0\u56E2\u961F\u7AE0\u7A0B, \u786E\u4FDD\u56E2\u961F\u59CB\u7EC8\u4E86\u89E3\u56E2\u961F\u57FA\u672C\u89C4\u5219, \u5E76\u6307\u5BFC\u65B0\u6210\u5458\u878D\u5165\u56E2\u961F\u3002</p><h4 id="itto" tabindex="-1"><a class="header-anchor" href="#itto" aria-hidden="true">#</a> ITTO</h4><p><img src="'+l+'" alt="\u9879\u76EE\u8D44\u6E90\u7BA1\u7406-\u89C4\u5212\u8D44\u6E90\u7BA1\u7406"></p><h3 id="\u4F30\u7B97\u6D3B\u52A8\u8D44\u6E90" tabindex="-1"><a class="header-anchor" href="#\u4F30\u7B97\u6D3B\u52A8\u8D44\u6E90" aria-hidden="true">#</a> \u4F30\u7B97\u6D3B\u52A8\u8D44\u6E90</h3><p>\u4F30\u7B97\u6267\u884C\u9879\u76EE\u6240\u9700\u7684\u56E2\u961F\u8D44\u6E90, \u6750\u6599\u3001\u8BBE\u5907\u548C\u7528\u54C1\u7684\u7C7B\u578B\u548C\u6570\u91CF\u7684\u8FC7\u7A0B\u3002</p><h4 id="itto-1" tabindex="-1"><a class="header-anchor" href="#itto-1" aria-hidden="true">#</a> ITTO</h4><p><img src="'+p+'" alt="\u9879\u76EE\u8D44\u6E90\u7BA1\u7406-\u4F30\u7B97\u6D3B\u52A8\u8D44\u6E90"></p><h2 id="\u6267\u884C\u8FC7\u7A0B\u7EC4" tabindex="-1"><a class="header-anchor" href="#\u6267\u884C\u8FC7\u7A0B\u7EC4" aria-hidden="true">#</a> \u6267\u884C\u8FC7\u7A0B\u7EC4</h2><h3 id="\u83B7\u53D6\u8D44\u6E90" tabindex="-1"><a class="header-anchor" href="#\u83B7\u53D6\u8D44\u6E90" aria-hidden="true">#</a> \u83B7\u53D6\u8D44\u6E90</h3><p>\u83B7\u53D6\u8D44\u6E90\u662F\u83B7\u53D6\u9879\u76EE\u6240\u9700\u7684\u56E2\u961F\u6210\u5458\u3001\u8BBE\u65BD\u3001\u8BBE\u5907\u3001\u6750\u6599\u3001\u7528\u54C1\u548C\u5176\u4ED6\u8D44\u6E90\u7684\u8FC7\u7A0B\u3002\u672C\u8FC7\u7A0B\u7684\u4E3B\u8981\u4F5C\u7528\u662F, \u6982\u8FF0\u548C\u6307\u5BFC\u8D44\u6E90\u7684\u9009\u62E9, \u5E76\u5C06\u5176\u5206\u914D\u7ED9\u76F8\u5E94\u7684\u6D3B\u52A8\u3002</p><p>\u5728\u83B7\u53D6\u9879\u76EE\u8D44\u6E90\u8FC7\u7A0B\u4E2D\u5E94\u6CE8\u610F\u4E0B\u5217\u4E8B\u9879\uFF1A</p><ol><li>\u9879\u76EE\u7ECF\u7406\u6216\u9879\u76EE\u56E2\u961F\u5E94\u8BE5\u8FDB\u884C\u6709\u6548\u8C08\u5224\u3002</li><li>\u4E0D\u80FD\u83B7\u5F97\u9879\u76EE\u6240\u9700\u7684\u8D44\u6E90\u65F6\u4F1A\u5F71\u54CD\u9879\u76EE, \u751A\u81F3\u53EF\u80FD\u5BFC\u81F4\u9879\u76EE\u53D6\u6D88\u3002</li><li>\u65E0\u6CD5\u83B7\u5F97\u6240\u9700\u56E2\u961F\u8D44\u6E90, \u9879\u76EE\u7ECF\u7406\u6216\u9879\u76EE\u56E2\u961F\u53EF\u80FD\u4E0D\u5F97\u4E0D\u7528\u66FF\u4EE3\u8D44\u6E90\u3002</li></ol><h4 id="itto-2" tabindex="-1"><a class="header-anchor" href="#itto-2" aria-hidden="true">#</a> ITTO</h4><p>\u9884\u5206\u6D3E =&gt; \u4E8B\u5148\u786E\u5B9A\u9879\u76EE\u7684\u5B9E\u7269\u6216\u56E2\u961F\u8D44\u6E90\u3002</p><ol><li>\u7ADE\u6807\u8FC7\u7A0B\u4E2D\u627F\u8BFA\u5206\u6D3E</li><li>\u9879\u76EE\u53D6\u51B3\u4E8E\u7279\u5B9A\u4EBA\u5458\u7684\u4E13\u6709\u6280\u80FD</li><li>\u9879\u76EE\u7AE0\u7A0B\u4E2D\u6307\u5B9A</li></ol><p>\u865A\u62DF\u56E2\u961F =&gt; \u5177\u6709\u5171\u540C\u76EE\u6807\u3001\u5728\u5B8C\u6210\u89D2\u8272\u4EBA\u7269\u7684\u8FC7\u7A0B\u4E2D\u5F88\u5C11\u6216\u6CA1\u6709\u65F6\u95F4\u9762\u5BF9\u9762\u5DE5\u4F5C\u7684\u4E00\u7FA4\u4EBA</p><p>\u5B9E\u7269\u8D44\u6E90\u5206\u914D\u5355\uFF1A\u9879\u76EE\u5C06\u4F7F\u7528\u7684\u6750\u6599\u3001\u8BBE\u5907\u3001\u7528\u54C1\u3001\u5730\u70B9\u548C\u5176\u4ED6\u5B9E\u7269\u8D44\u6E90\u3002</p><p>\u9879\u76EE\u56E2\u961F\u6D3E\u5DE5\u5355\uFF1A\u8BB0\u5F55\u4E86\u56E2\u961F\u6210\u5458\u53CA\u5176\u5728\u9879\u76EE\u4E2D\u7684\u89D2\u8272\u548C\u804C\u8D23\uFF08\u82B1\u540D\u518C\uFF09\u3002</p><p>\u8D44\u6E90\u65E5\u5386\uFF1A\u8D44\u6E90\u4F55\u65F6\u53EF\u7528, \u53EF\u7528\u591A\u4E45\u3002</p><p><img src="'+h+'" alt="\u9879\u76EE\u8D44\u6E90\u7BA1\u7406-\u83B7\u53D6\u8D44\u6E90"></p><h3 id="\u5EFA\u8BBE\u56E2\u961F" tabindex="-1"><a class="header-anchor" href="#\u5EFA\u8BBE\u56E2\u961F" aria-hidden="true">#</a> \u5EFA\u8BBE\u56E2\u961F</h3><p>\u5EFA\u8BBE\u56E2\u961F\u662F\u63D0\u9AD8\u5DE5\u4F5C\u80FD\u529B, \u4FC3\u8FDB\u56E2\u961F\u6210\u5458\u4E92\u52A8, \u6539\u5584\u56E2\u961F\u6574\u4F53\u6C1B\u56F4, \u4EE5\u63D0\u9AD8\u9879\u76EE\u7EE9\u6548\u7684\u8FC7\u7A0B\u3002</p><p>\u5854\u514B\u66FC\u9636\u68AF\u7406\u8BBA\uFF1A</p><ul><li>\u5F62\u6210\u9636\u6BB5\uFF1A\u76F8\u4E92\u8BA4\u8BC6, \u76F8\u4E92\u72EC\u7ACB, \u4E0D\u4E00\u5B9A\u5F00\u8BDA\u5E03\u516C\u3002</li><li>\u9707\u8361\u9636\u6BB5\uFF1A\u4E0D\u540C\u89C2\u70B9\u548C\u610F\u89C1, \u6709\u51B2\u7A81\u3002</li><li>\u89C4\u8303\u9636\u6BB5\uFF1A\u5F00\u59CB\u534F\u540C\u5DE5\u4F5C, \u5B66\u4E60\u76F8\u4E92\u4FE1\u4EFB\u3002</li><li>\u6210\u719F\u9636\u6BB5\uFF1A\u7EC4\u7EC7\u6709\u5E8F, \u76F8\u4E92\u4F9D\u9760, \u5E73\u7A33\u9AD8\u6548\u3002</li><li>\u89E3\u6563\u9636\u6BB5\uFF1A\u91CA\u653E\u4EBA\u5458, \u89E3\u6563\u56E2\u961F\u3002</li></ul><h4 id="itto-3" tabindex="-1"><a class="header-anchor" href="#itto-3" aria-hidden="true">#</a> ITTO</h4><p>\u96C6\u4E2D\u529E\u516C\uFF1A\u589E\u8FDB\u6C9F\u901A\u548C\u96C6\u4F53\u611F, \u8001\u7248\u672C\u4E2D\u6709\u201C\u7D27\u5BC6\u77E9\u9635\u201D\u7684\u8BF4\u6CD5\u3002</p><p>\u56E2\u961F\u5EFA\u8BBE\uFF1A\u5404\u79CD\u6D3B\u52A8\uFF08\u751A\u81F3\u5F00\u4F1A\uFF09\u76EE\u7684\uFF1A\u534F\u540C\u5DE5\u4F5C\u3001\u589E\u5F3A\u4FE1\u4EFB\u3002\u662F\u4E3A\u4E86\u66F4\u597D\u7684\u534F\u540C\u5DE5\u4F5C\u3002</p><p>\u57F9\u8BAD\uFF1A\u5305\u62EC\u65E8\u5728\u63D0\u9AD8\u9879\u76EE\u56E2\u961F\u6210\u5458\u80FD\u529B\u3001\u51CF\u5C11\u6210\u5458\u4E4B\u95F4\u7684\u5DEE\u5F02\u7684\u5168\u90E8\u6D3B\u52A8\u3002</p><p>\u56E2\u961F\u7EE9\u6548\u8BC4\u4EF7\uFF1A1.\u4E2A\u4EBA\u6280\u80FD\u7684\u6539\u8FDB, 2.\u56E2\u961F\u80FD\u529B\u7684\u6539\u8FDB, 3.\u56E2\u961F\u6210\u5458\u79BB\u804C\u7387\u7684\u964D\u4F4E, 4.\u56E2\u961F\u51DD\u805A\u529B\u7684\u52A0\u5F3A\u3002</p><p><img src="'+s+'" alt="\u9879\u76EE\u8D44\u6E90\u7BA1\u7406-\u5EFA\u8BBE\u56E2\u961F"></p><h3 id="\u7BA1\u7406\u56E2\u961F" tabindex="-1"><a class="header-anchor" href="#\u7BA1\u7406\u56E2\u961F" aria-hidden="true">#</a> \u7BA1\u7406\u56E2\u961F</h3><p>\u7BA1\u7406\u56E2\u961F\u662F\u8DDF\u8E2A\u56E2\u961F\u6210\u5458\u5DE5\u4F5C\u8868\u73B0, \u63D0\u4F9B\u53CD\u9988, \u89E3\u51B3\u95EE\u9898\u5E76\u7BA1\u7406\u56E2\u961F\u53D8\u66F4, \u4EE5\u4F18\u5316\u9879\u76EE\u7EE9\u6548\u7684\u8FC7\u7A0B\u3002\u672C\u8FC7\u7A0B\u7684\u4E3B\u8981\u4F5C\u7528\u662F, \u5F71\u54CD\u56E2\u961F\u884C\u4E3A\u3001\u7BA1\u7406\u51B2\u7A81\u4EE5\u53CA\u89E3\u51B3\u95EE\u9898\u3002</p><h4 id="itto-4" tabindex="-1"><a class="header-anchor" href="#itto-4" aria-hidden="true">#</a> ITTO</h4><p>\u6210\u529F\u7684\u51B2\u7A81\u7BA1\u7406\u53EF\u63D0\u9AD8\u751F\u4EA7\u529B, \u6539\u8FDB\u5DE5\u4F5C\u5173\u7CFB\u30021.\u56E2\u961F\u6210\u5458\u89E3\u51B3, 2.\u9879\u76EE\u7ECF\u7406\u534F\u52A9, 3.\u6B63\u5F0F\u7684\u7A0B\u5E8F, \u5305\u62EC\u60E9\u6212\u63AA\u65BD\u3002</p><p>\u51B2\u7A81\u6765\u6E90\uFF1A1.\u8D44\u6E90\u7A00\u7F3A\uFF1B2.\u8FDB\u5EA6\u4F18\u5148\u7EA7\u6392\u5E8F\uFF1B3.\u4E2A\u4EBA\u5DE5\u4F5C\u98CE\u683C\u5DEE\u5F02\uFF1B4.\u6027\u683C\u5DEE\u5F02</p><p>\u51B2\u7A81\u7BA1\u7406\u7684\u89E3\u51B3\u6B65\u9AA4\uFF1A</p><ol><li>\u9996\u5148\u7531\u9879\u76EE\u56E2\u961F\u6210\u5458\u8D1F\u8D23\u89E3\u51B3</li><li>\u51B2\u7A81\u5347\u7EA7, \u9879\u76EE\u7ECF\u7406\u5E94\u63D0\u4F9B\u534F\u52A9\uFF08\u79C1\u4E0B\u5904\u7406\uFF09</li><li>\u5982\u679C\u7834\u574F\u6027\u51B2\u7A81\u7EE9\u6548\u5B58\u5728, \u5219\u53EF\u4F7F\u7528\u6B63\u5F0F\u7A0B\u5E8F, \u5305\u62EC\u91C7\u53D6\u60E9\u6212\u63AA\u65BD</li></ol><p>\u4E94\u79CD\u5E38\u7528\u7684\u51B2\u7A81\u89E3\u51B3\u65B9\u6CD5\uFF1A</p><ul><li>\u64A4\u9000/\u56DE\u907F\uFF1A\u4ECE\u51B2\u7A81\u4E2D\u9000\u51FA, \u63A8\u8FDF, \u63A8\u7ED9\u4ED6\u4EBA\u89E3\u51B3\u3002</li><li>\u7F13\u548C/\u5305\u5BB9\uFF1A\u5F3A\u8C03\u4E00\u81F4\u800C\u975E\u5DEE\u5F02\uFF1B\u8003\u8651\u5176\u4ED6\u65B9\u7684\u9700\u8981\u3002\uFF08\u6C42\u540C\u5B58\u5F02\uFF09</li><li>\u59A5\u534F/\u8C03\u89E3\uFF1A\u90E8\u5206\u89E3\u51B3\u95EE\u9898, \u4E00\u5B9A\u7A0B\u5EA6\u4E0A\u6EE1\u610F\u3002</li><li>\u5F3A\u8FEB/\u547D\u4EE4\uFF1A\u63A8\u884C\u4E00\u65B9\u89C2\u70B9\uFF1B\u901A\u5E38\u901A\u8FC7\u6743\u529B\u5F3A\u884C\u89E3\u51B3\u7D27\u6025\u95EE\u9898\u3002</li><li>\u5408\u4F5C/\u89E3\u51B3\u95EE\u9898\uFF1A\u7EFC\u5408\u8003\u8651\u4E0D\u540C\u7684\u89C2\u70B9\u548C\u610F\u89C1, \u5408\u4F5C\u7684\u6001\u5EA6\u548C\u5F00\u653E\u5F0F\u5BF9\u8BDD\u8FBE\u6210\u5171\u8BC6, \u5F15\u5BFC\u5404\u65B9\u8FBE\u6210\u5171\u8BC6\u548C\u627F\u8BFA\u3002\uFF08\u6700\u4F73\u65B9\u5F0F\uFF09</li></ul><p><img src="'+d+'" alt="\u9879\u76EE\u8D44\u6E90\u7BA1\u7406-\u7BA1\u7406\u56E2\u961F"></p><h2 id="\u63A7\u5236\u8FC7\u7A0B\u7EC4" tabindex="-1"><a class="header-anchor" href="#\u63A7\u5236\u8FC7\u7A0B\u7EC4" aria-hidden="true">#</a> \u63A7\u5236\u8FC7\u7A0B\u7EC4</h2><h3 id="\u63A7\u5236\u8D44\u6E90" tabindex="-1"><a class="header-anchor" href="#\u63A7\u5236\u8D44\u6E90" aria-hidden="true">#</a> \u63A7\u5236\u8D44\u6E90</h3><p>\u786E\u4FDD\u6309\u8BA1\u5212\u4E3A\u9879\u76EE\u5206\u914D\u5B9E\u7269\u8D44\u6E90, \u76D1\u7763\u8D44\u6E90\u5B9E\u9645\u4F7F\u7528\u60C5\u51B5, \u5E76\u91C7\u53D6\u5FC5\u8981\u7EA0\u6B63\u63AA\u65BD\u7684\u8FC7\u7A0B\u3002\u4E3B\u8981\u4F5C\u7528\u662F, \u786E\u4FDD\u8D44\u6E90\u9002\u65F6\u9002\u5730\u53EF\u7528\u4E8E\u9879\u76EE, \u4E14\u5728\u4E0D\u518D\u9700\u8981\u65F6\u88AB\u91CA\u653E\u3002</p><p>\u5E94\u5728\u6240\u6709\u9879\u76EE\u9636\u6BB5\u548C\u6574\u4E2A\u9879\u76EE\u751F\u547D\u5468\u671F\u671F\u95F4\u6301\u7EED\u5F00\u5C55\u63A7\u5236\u8D44\u6E90\u8FC7\u7A0B\u3002</p><h4 id="itto-5" tabindex="-1"><a class="header-anchor" href="#itto-5" aria-hidden="true">#</a> ITTO</h4><p><img src="'+n+'" alt="\u9879\u76EE\u8D44\u6E90\u7BA1\u7406-\u63A7\u5236\u8D44\u6E90"></p>',62),u=[o];function m(g,_){return i(),e("div",null,u)}var b=a(c,[["render",m],["__file","project-resource-management.html.vue"]]);export{b as default};
